import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/js/bootstrap.bundle.min';
import $ from 'jquery';


function App() {
  data = ''
  $.ajax({
    url: "http://127.0.0.1:5000",
    contentType: "application/json"
})
    .done(
        function (abcd) {
            data = abcd
        }.bind(this)
    )
    .fail(
        function (datas) {
        }
    );

  return (
    <div className="App">
     {data}
    </div>
  );
}

export default App;
